import React from 'react';













const ProductList = () => {
  const veg = [
    {title : 'Shimla' , id : 1},
    {title : 'Almond' , id : 2},
    {title : 'Cabage' , id : 3},
  ];


  const listItems = veg.map(vegs=>(
    <li key = {vegs.id}>
      {vegs.title}
    </li>
  ))
  return(
    <ul>

      {listItems}
    </ul>
  );
}
export default ProductList;
